import React, { Component } from 'react';
import { Container, Row, Col,Image} from 'react-bootstrap';


class UserProfile extends Component {

	render() {
		return (

			<Container>
				<Row>
					<Col xs={6} md={4}>
						<Image src="/Images/users/1.jpg" rounded  alt="" />" rounded />
					</Col>
					<Col xs={6} md={4}>
						<Image src="/Images/users/1.jpg" roundedCircle alt="" />" roundedCircle />
					</Col>
					<Col xs={6} md={4}>
						<Image src="/Images/users/1.jpg" thumbnail  alt="" />" thumbnail />
					</Col>
				</Row>
			</Container>
		);
	}
}

export default UserProfile;
